import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  background-color: #f4f4f4;
  width: 100%;
  height: 722px;
  & > div {
    width: 993px;
    margin: 0 auto;
    height: 100%;
    padding-top: 103px;
    box-sizing: border-box;
    & > .top {
      & > .logo {
        background-image: url("/assets/greensteach.svg");
        background-position: center;
        background-repeat: no-repeat;
        background-size: cover;
        width: 113px;
        height: 44.1px;
        color: white;
        font-size: 16px;
        font-weight: bold;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      & > .title {
        margin-top: 8px;
        font-size: 40px;
        font-weight: bold;
        line-height: 1.38;
      }
    }
  }
`;
function NoticeSection() {
  return (
    <Wrapper>
      <div>
        <div className="top">
          <div className="logo">고객지원</div>
          <div className="title">
            김과장 컨설팅에서 <br /> 알려드립니다
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default NoticeSection;
